/*=============================================
BOTON QUE GENERA LOS RESULTADOS BAJAS POR FILTRADO DE FECHAS Y RESULTADO
=============================================*/

$(document).on("click", ".btnBajasResultadosReporte", function() {

//alert("cosa");
	$('#tablaBajasResultadosReporte').remove();
	$('#tablaBajasResultadosReporte_wrapper').remove();

	var fechaInicio = $("#reporteFechaInicio").val();
	var fechaFin = $("#reporteFechaFin").val();
	var resultado = $('input:radio[name=reporteResultado]:checked').val();

	var datos = new FormData();
	datos.append("reporte", 'reporte');
	datos.append("fechaInicio", fechaInicio);
	datos.append("fechaFin", fechaFin);
	datos.append("resultado", resultado);

	$.ajax({

		url: "ajax/reportes_bajas.ajax.php",
		method: "POST",
		data: datos,
		cache: false,
		contentType: false,
		processData: false,
		dataType: "json",
		success: function(respuesta) {
			//console.log(respuesta);
			$("#reporteBajas").append(

			  '<table class="table table-bordered table-striped dt-responsive table-hover" id="tablaBajasResultadosReporte" width="100%">'+
                
                '<thead>'+
                  
                  '<tr>'+
                    '<th>N°</th>'+
                    '<th>ESTABLECIMIENTO</th>'+
                    '<th>N° BAJAS</th>'+
                     '<th>TOTALES HA HOY </th>'+
                   '</tr>'+

                '</thead>'+
                
              '</table>'  

            ); 			

			var t = $('#tablaBajasResultadosReporte').DataTable({

				"data": respuesta,

				"columns": [
					{ data: "establecimiento" },
						  { data: "nombre" },
		            { data: "sumadia" },
		             { data: "suma" },
		           
		        ],

				"deferRender": true,

				"processing" : true,

				"language": {

					"sProcessing":     "Procesando...",
					"sLengthMenu":     "Mostrar _MENU_ registros",
					"sZeroRecords":    "No se encontraron resultados",
					"sEmptyTable":     "Ningún dato disponible en esta tabla",
					"sInfo":           "Mostrando registros del _START_ al _END_ de un total de _TOTAL_",
					"sInfoEmpty":      "Mostrando registros del 0 al 0 de un total de 0",
					"sInfoFiltered":   "(filtrado de un total de _MAX_ registros)",
					"sInfoPostFix":    "",
					"sSearch":         "Buscar:",
					"searchPlaceholder": "Escribe aquí para buscar...",
					"sUrl":            "",
					"sInfoThousands":  ",",
					"sLoadingRecords": "Cargando...",
					"oPaginate": {
					"sFirst":    "Primero",
					"sLast":     "Último",
					"sNext":     "Siguiente",
					"sPrevious": "Anterior"
					},
					"oAria": {
						"sSortAscending":  ": Activar para ordenar la columna de manera ascendente",
						"sSortDescending": ": Activar para ordenar la columna de manera descendente"
					}
					
				},

				"lengthChange": false,

				"searching": true,

				"ordering": false, 
        		
        		"info":     true,

        		//para usar los botones   
		        "responsive": true,

		        "dom": 'Bfrtilp',       
		        
		        "buttons":[

/* 						'copyHtml5',
						'excelHtml5',
						'csvHtml5',
						'pdfHtml5' */
					{
						extend:    'excelHtml5',
						title: 	   'Reporte '+fechaInicio+' '+fechaFin+' '+resultado,
						text:      '<i class="fas fa-file-excel"></i> Generar EXCEL',
						titleAttr: 'Exportar a Excel',
						className: 'btn btn-success m-1',
						
					},
				 {
						extend:    'csvHtml5',
						text:      '<i class="fas fa-file-csv"></i> Generar CSV',
					    titleAttr: 'Exportar a CSV',
					    className: 'btn btn-warning m-1',
					    title: 'Reporte- '  +fechaInicio+ '-' + fechaFin + ' '+ resultado,
					},
					{
						extend:    'copyHtml5',
						text:      '<i class="fas fa-copy"></i> Copiar',
					   titleAttr: 'Copiar',
					   className: 'btn btn-secondary m-1'
					},
					
				]	        

			});

		},
	    error: function(error){

	      console.log("No funciona");
	        
	    }

	});

});


/*=============================================
BOTON QUE GENERA EL PDF DE LOS RESULTADOS BAJAS POR FILTRADO DE FECHAS Y RESULTADO
=============================================*/

$(document).on("click", ".btnBajasResultadosPDF", function() {

	var fechaInicio = $("#reporteFechaInicio").val();
	console.log("fechaInicio", fechaInicio);
	var fechaFin = $("#reporteFechaFin").val();
	console.log("fechaFin", fechaFin);
	var resultado = $('input:radio[name=reporteResultado]:checked').val();

	var nombre_usuario = $("#nombreUsuarioOculto").val();

	var datos = new FormData();

	datos.append("reportePDF", "reportePDF");
	datos.append("fechaInicio", fechaInicio);
	datos.append("fechaFin", fechaFin);
	datos.append("resultado", resultado);
	datos.append("nombre_usuario", nombre_usuario);

	$('.cargando').removeClass('hide');

	$.ajax({

		url: "ajax/reportes_bajas.ajax.php",
		type: "POST",
		data: datos,
		cache: false,
		contentType: false,
		processData: false,
		success: function(respuesta) {

			$('.cargando').addClass('hide');

			$('#ver-pdf').modal({

				show:true,
				backdrop:'static'

			});	
			//daniel
			PDFObject.embed("temp/reporte-"+fechaInicio+"-"+fechaFin+"-"+resultado+".pdf", "#view_pdf");

		}

	});

});


