/*=============================================================
	BOTON QUE GENERA EL PDF DE LOS RESULTADOS BAJAS PERSONAL
===============================================================*/

$(document).on("click", ".btnImprimirBajasResultadoLab", function() {
	
	var idFicha = $(this).attr("idFicha");
	var code = $(this).data("code");
	var datos = new FormData();

	datos.append("fichaBajasResultado", "fichaBajasResultado");
	datos.append("idFicha", idFicha);

	//Para mostrar alerta personalizada de loading
	swal.fire({
        text: 'Procesando...',
        allowOutsideClick: false,
        allowEscapeKey: false,
        allowEnterKey: false,
        onOpen: () => {
            swal.showLoading()
        }
    });

	$.ajax({

		url: "ajax/reportes_covid_lab.ajax.php",
		type: "POST",
		data: datos,
		cache: false,
		contentType: false,
		processData: false,
		success: function(respuesta) {

			//Para cerrar la alerta personalizada de loading
			swal.close();

			$('#ver-pdf').modal({

				show:true,
				backdrop:'static'

			});	

			PDFObject.embed("temp/"+code+"/resultado-laboratorio-"+idFicha+".pdf", "#view_pdf");

		}

	});

});

